import React from "react";
import "./OrderForm.css";

const OrderForm = function OrderForm() {
  return (
    <header className="header">
      Teknolojik Yemekler
      <nav>
        <ul>
          <a>Ana Sayfa</a>
          <a>Seçenekler</a>
          <a>Sipariş Oluştur</a>
        </ul>
      </nav>
    </header>
  );
};

export default OrderForm;
